import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom';
import App from './App';

import 'antd/dist/antd.css'

const root = ReactDOM.createRoot(document.getElementById('app'));
root.render(
	<BrowserRouter>
		<App />
	</BrowserRouter>
);
